rong&gt;Doba trvání a pravidla pořizování služeb HP CarePack: &lt;/strong&gt;Služba začíná platit datem nákupu HW a trvá po dobu specifikovanou v dokumentech HP CarePack. HP CarePack je možno zakoupit nejpozději do 90 dnů od zakoupení HW koncovým uživatelem (ať je to firma nebo fyz.osoba). Registrace CPE - do 10 dnů od zakoupení Care Packu koncovým uživatelem.&lt;br /&gt; &lt;br /&gt; Službu HP CarePack označenou jako &lt;strong&gt;Post Warranty&lt;/strong&gt; lze zakoupit nejdříve 90 dní před ukončením standardní záruky nebo v době ukončení platnosti předchozí služby HP CarePack. Post Warranty je možné koupit nejpozději do 30 dnů od data ukončení standardní záruky nebo předchozí služby HP CarePack. V době nákupu HW nelze nakupovat ani registrovat službu HP Care Pack současně s Post Warranty a samotnou službu Post Warranty. V době nákupu HW je možné prodloužit nebo povýšit servisní úroveň pouze službou HP CarePack. Kontakt pro nahlašování servisních požadavků na telefonu 261 307 310. Datum Care Packu musí být vždy shodný se zárukou zařízení. Registrace nejlépe na konci záruky zařízení, kdy se datum nastaví na předchozí záruku (CP) nebo nastaví HP Carepack team.&lt;/p&gt;  &lt;p dir='LTR' align='LEFT'&gt; &lt;/p&gt;  &lt;p dir='LTR' align='LEFT'&gt;&lt;strong&gt;BR, oprava v servisním středisku, Return to Depot:&lt;/strong&gt; Oprava v servisním středisku zahrnuje telefonní podporu, opravu nebo výměnu vadné jednotky a vrácení plně funkční jednotky. Zákazník musí doručit zařízení do HP servisního střediska. Služba zahrnuje veškeré nahradní díly a servisní práce. Doba trvání opravy pro tuto službu je dva, pět nebo sedm pracovních dnů v závislosti na typu zakoupeného produktu. Opakované závady mohou vyžadovat dodatečný čas pro opravu. Služba je k dispozici od 8:00 – 17:00 hod. od pondělí do pátku vyjma státních svátků. Zahájení opravy následující pracovní den.&lt;br /&gt; &lt;strong&gt;NDO, Next Business Day On-site, HW Support:&lt;/strong&gt; Zahájení opravy následující pracovní den je služba, která zákazníkovi zaručuje telefonní podporu a podporu přímo v místě instalace zařízení HP produktů. Služba zahrnuje veškeré nahradní díly, servisní práce a cestu technika. Služba je k dispozici od 8:00 – 17:00 hod. od pondělí do pátku vyjma státních svátků. Odborný pracovník dorazí na pracoviště následující pracovní den, poté co byl zaregistrován telefonický požadavek, a začne pracovat na odstranění HW problému.&lt;br /&gt; &lt;strong&gt;4OS, zahájení opravy do 4 hodin od nahlášení závady v rozšířenou pracovní dobu, 4-hour, 13x5 On-site, HW Support:&lt;/strong&gt; Zahájení opravy do 4 hodin od nahlášení závady v rozšířenou pracovní dobu je služba, která zákazníkovi zaručuje telefonní podporu a podporu přímo v místě instalace zařízení HP produktů. Služba zahrnuje veškeré nahradní díly, servisní práce a cestu technika. Služba je k dispozici od 8:00 – 21:00 hod. od pondělí do pátku vyjma státních svátků. Veškeré požadavky na zásah musí být nahlášeny do 17:00 hod. Odborný pracovník dorazí na pracoviště do 4 hodin od nahlášení závady, poté co byl zaregistrován telefonický požadavek, a začne pracovat na odstranění HW problému.&lt;br /&gt; &lt;strong&gt;NDR, oprava výměnou, Next Day Exchange, HW Support:&lt;/strong&gt; Pokud nemůže být technický problém vyřešen na dálku, HP vymění vadný produkt za trvalou náhradní jednotku. Náhradní jednotka bude nový nebo renovovaný produkt ve stavu odpovídající novému, poskytující funkčnost minimálně stejnou jako je ta, kterou měl nahrazovaný produkt. Autorizovaný kurýr HP doručí náhradní jednotku na místo určení následující pracovní den od nahlášení problému. HP doručí náhradní produkt v obalu vhodném pro vrácení vadného produktu, který se stává majetkem HP. Služba je k dispozici od 8:00 – 17:00 hod. od pondělí do pátku vyjma státních svátků. Veškeré požadavky na zásah musí být doručeny do HP do 15:00 hod.&lt;/p&gt;","false","0","0001005000030003","1791","207","true","00020099","4198","-1","true","12","Měsíc(ů